using System;
using Microsoft.Xna.Framework;
using StardewValley;
using StardewValley.Extensions;
using StardewValley.Menus;
using StardewValley.Tools;
using TASMod.Extensions;

namespace TASMod.Simulators.Fishing
{
    public class SBobberBar
    {
        public SBobberBar(BobberBar _bobberBar)
        {

        }
        public void update(bool buttonPress) { }
    }

    public class SFishingGame
    {
        public Random Game1_random;
        // farmer props
        public float jitterStrength;
        public Vector2 jitter;
        public int blinkTimer;
        // fishing props
        public Vector2 bobber;
        public bool isFishing;
        public bool isNibbling;
        public bool isReeling;
        public float bobberTimeAccumulator;
        public float timePerBobberBob;
        public int bobberBob;
        // location props
        public int numArtifactSpots;

        // daytime money box
        public int moneyShakeTimer;
        public int timeShakeTimer;
        public int questPulseTimer;
        public int whenToPulseTimer;

        public SBobberBar bobberBar;

        public SFishingGame()
        {
            // clone from current game
            Game1_random = Game1.random.Copy();
            // farmer props
            jitterStrength = Game1.player.jitterStrength;
            jitter = Game1.player.jitter;
            blinkTimer = Game1.player.blinkTimer;

            // fishing props
            bobber = (Game1.player.CurrentTool as FishingRod).bobber.Value;
            isFishing = (Game1.player.CurrentTool as FishingRod).isFishing;
            isNibbling = (Game1.player.CurrentTool as FishingRod).isNibbling;
            isReeling = (Game1.player.CurrentTool as FishingRod).isReeling;
            bobberTimeAccumulator = (Game1.player.CurrentTool as FishingRod).bobberTimeAccumulator;
            timePerBobberBob = (Game1.player.CurrentTool as FishingRod).timePerBobberBob;
            bobberBob = (Game1.player.CurrentTool as FishingRod).bobberBob;

            // location props
            foreach (var obj in Game1.currentLocation.Objects.Values)
            {
                switch (obj.QualifiedItemId)
                {
                    case "(O)590":
                    case "(O)SeedSpot":
                        numArtifactSpots++;
                        break;
                }
            }

            // daytime money box
            moneyShakeTimer = Game1.dayTimeMoneyBox.moneyShakeTimer;
            timeShakeTimer = Game1.dayTimeMoneyBox.timeShakeTimer;
            questPulseTimer = Game1.dayTimeMoneyBox.questPulseTimer;
            whenToPulseTimer = Game1.dayTimeMoneyBox.whenToPulseTimer;

            // bobber bar
            bobberBar = new SBobberBar(Game1.activeClickableMenu as BobberBar);
        }

        public void Step(bool buttonPress)
        {
            // update
            updateActiveMenu(buttonPress);
            UpdateCharacters(buttonPress);
            UpdateLocations(buttonPress);
            UpdateOther(buttonPress);

            // draw
            DrawWorld(buttonPress);
            DrawHud(buttonPress);
        }

        public void updateActiveMenu(bool buttonPress)
        {
            BobberBar_update(buttonPress);
        }

        public void UpdateOther(bool buttonPress)
        {
            if (Game1.currentLocation.Name == "Beach")
            {
                // seagulls audio check
                Game1_random.NextDouble();
            }
        }

        public void UpdateCharacters(bool buttonPress)
        {
            // Farmer.updateCommon
            if (jitterStrength > 0f)
            {
                jitter = new Vector2((float)Game1_random.Next(-(int)(jitterStrength * 100f), (int)((jitterStrength + 1f) * 100f)) / 100f, (float)Game1_random.Next(-(int)(jitterStrength * 100f), (int)((jitterStrength + 1f) * 100f)) / 100f);
            }
            blinkTimer += 16;
            if (blinkTimer > 2200 && Game1_random.NextDouble() < 0.01)
            {
                blinkTimer = -150;
            }

            FishingRod_tickUpdate(buttonPress);
        }

        public void FishingRod_tickUpdate(bool buttonPress)
        {
            if (isReeling)
            {
                if (buttonPress)
                {
                    jitterStrength = 1;
                }
                else
                {
                    jitterStrength = 0;
                }
                _ = new Vector2((float)Game1_random.Next(-10, 11) / 10f, (float)Game1_random.Next(-10, 11) / 10f);
                bobberTimeAccumulator += 16;
            }
        }

        public void UpdateLocations(bool buttonPress)
        {
            switch (Game1.currentLocation.Name)
            {
                case "Beach":
                    Beach_updateWhenCurrentLocation(buttonPress);
                    break;
                case "Mountain":
                    throw new NotImplementedException();
                case "Forest":
                    throw new NotImplementedException();
                case "Farm":
                    throw new NotImplementedException();
                case "Desert":
                    throw new NotImplementedException();
                case "Town":
                    throw new NotImplementedException();
                case "Secret Woods":
                    throw new NotImplementedException();
                default:
                    throw new NotImplementedException($"{Game1.currentLocation.Name}");
            }
        }

        public void base_updateWhenCurrentLocation(bool buttonPress)
        {
            // TODO:critters.update and remove all that are purged
            for (int i = 0; i < numArtifactSpots; i++)
            {
                Game1_random.NextDouble();
            }
        }

        public void Beach_updateWhenCurrentLocation(bool buttonPress)
        {
            base_updateWhenCurrentLocation(buttonPress);
            if (Game1.eventUp || !(Game1_random.NextDouble() < 1E-06))
            {
                return;
            }
            Vector2 position = new Vector2(Game1_random.Next(15, 47) * 64, Game1_random.Next(29, 42) * 64);
            bool draw = true;
            for (float i = position.Y / 64f; i < (float)Game1.currentLocation.map.RequireLayer("Back").LayerHeight; i += 1f)
            {
                if (!Game1.currentLocation.isWaterTile((int)position.X / 64, (int)i) || !Game1.currentLocation.isWaterTile((int)position.X / 64 - 1, (int)i) || !Game1.currentLocation.isWaterTile((int)position.X / 64 + 1, (int)i))
                {
                    draw = false;
                    break;
                }
            }
            if (draw)
            {
                Game1_random.Next(7);
            }
        }

        public void BobberBar_update(bool buttonPress)
        {
            //actual game update
            bobberBar.update(buttonPress);
            // post update
            FishingRod_tickUpdate(buttonPress);
        }

        public void DrawWorld(bool buttonPress)
        {
            //FishingRod.draw()
            if (!bobber.Equals(Vector2.Zero) && isFishing)
            {
                if (bobberTimeAccumulator > timePerBobberBob)
                {
                    if ((!isNibbling && !isReeling) || Game1_random.NextDouble() < 0.05)
                    {
                        Game1_random.NextBool();
                    }
                    timePerBobberBob = ((bobberBob == 0) ? Game1_random.Next(1500, 3500) : Game1_random.Next(350, 750));
                    bobberTimeAccumulator = 0f;
                    if (isNibbling || isReeling)
                    {
                        timePerBobberBob = Game1_random.Next(25, 75);
                        Game1_random.Next(-5, 5);
                        Game1_random.Next(-5, 5);
                        if (!isReeling)
                        {
                            _ = (float)Game1_random.Next(-20, 20) / 100f;
                        }
                    }
                    else if (Game1_random.NextDouble() < 0.1)
                    {
                    }
                }
            }
        }

        public void DrawHud(bool buttonPress)
        {
            //DayTimeMoneyBox.draw()
            if (timeShakeTimer > 0)
            {
                timeShakeTimer -= Game1.currentGameTime.ElapsedGameTime.Milliseconds;
            }
            if (questPulseTimer > 0)
            {
                questPulseTimer -= Game1.currentGameTime.ElapsedGameTime.Milliseconds;
            }
            if (whenToPulseTimer >= 0)
            {
                whenToPulseTimer -= Game1.currentGameTime.ElapsedGameTime.Milliseconds;
                if (whenToPulseTimer <= 0)
                {
                    whenToPulseTimer = 3000;
                    if (Game1.player.hasNewQuestActivity())
                    {
                        questPulseTimer = 1000;
                    }
                }
            }
            // timePosition
            if (timeShakeTimer > 0)
            {
                Game1_random.Next();
                Game1_random.Next();
            }
            if (Game1.player.hasVisibleQuests)
            {
                if (questPulseTimer > 0)
                {
                    float scaleMult = 1f / (Math.Max(300f, Math.Abs(questPulseTimer % 1000 - 500)) / 500f);
                    if (scaleMult > 1f)
                    {
                        Game1_random.Next();
                        Game1_random.Next();
                    }
                }
            }

            // drawMoneyBox
            if (moneyShakeTimer > 0)
            {
                Game1_random.Next();
                Game1_random.Next();
                Game1_random.Next();
                Game1_random.Next();
                moneyShakeTimer -= Game1.currentGameTime.ElapsedGameTime.Milliseconds;
            }
        }
    }
}
